  emulator:
    Package: emulator
    Type: Package
    Title: Bayesian Emulation of Computer Programs
    Version: 1.2-21
    Authors@R: person(given=c("Robin", "K. S."), family="Hankin", role = c("aut","cre"),
      email="hankin.robin@gmail.com", comment = c(ORCID = "0000-0001-5982-0415"))
    VignetteBuilder: knitr
    Depends: R (>= 3.0.1), mvtnorm
    Suggests: knitr,rmarkdown
    Maintainer: Robin K. S. Hankin <hankin.robin@gmail.com>
    Description: "\n Allows one to estimate the output of a computer program,\n as
      a function of the input parameters, without actually running it.\n The computer
      program is assumed to be a Gaussian process, whose\n parameters are estimated
      using Bayesian techniques that give a PDF of\n expected program output.  This
      PDF is conditional on a training set\n of runs, each consisting of a point in
      parameter space and the model\n output at that point.  The emphasis is on complex
      codes that take\n weeks or months to run, and that have a large number of undetermined\n
      input parameters; many climate prediction models fall into this\n class.  The
      emulator essentially determines Bayesian posterior\n estimates of the PDF of
      the output of a model, conditioned on results\n from previous runs and a user-specified
      prior linear model.  The\n package includes functionality to evaluate quadratic
      forms \n efficiently. "
    License: GPL
    URL: https://github.com/RobinHankin/emulator
